import styled from 'styled-components';

const HeaderContainer = styled.header`
  display: flex;
  justify-content: space-between;
  align-items: center;
  border-bottom: 1px solid black;
  padding: 0 30px;
  background-color: #fff;
  color: #000;
  box-shadow: 0 1px 5px rgba(0, 0, 0, 0.1);
  h2 {
    font-size: 1.5rem;
    margin: 20px 0;
  }
`;

const IconGroup = styled.div`
  display: flex;
  gap: 16px;
  align-items: center;
  width: 120px;
  justify-content: flex-end;
`;

const ThemeIcon = styled.img`
  width: 30px;
  height: 30px;
  cursor: pointer;
  border-radius: 50%;
  &:hover {
    opacity: 0.8;
  }
`;

const ProfilePhoto = styled.img`
  height: 30px;
  width: 30px;
  border-radius: 50%;
  cursor: pointer;
  border: 2px solid #ddd;
  &:hover {
    border-color: #007bff;
    transition: border-color 0.2s;
  }
`;

function Header({ titulo }) {
  return (
    <HeaderContainer>
      <h2>{titulo}</h2>
      <IconGroup>
        <ThemeIcon src="data:image/svg+xml;base64," alt="Tema" />
        <ProfilePhoto src="data:image/svg+xml;base64," alt="Perfil" />
      </IconGroup>
    </HeaderContainer>
  );
}

export default Header;
